import './App.css';

function App() {
    return (
        <div className="App">
            <header className='header'>
                <div className='container'>
                    <nav className='header-nav'>
                        <img src="src\images\logo.svg" alt="Лого" />
                        <ul className='nav-links'>
                            <li>ГЛАВНОЕ</li>
                            <li>ИНФОРМАЦИЯ</li>
                            <li>О НАС</li>
                        </ul>
                    </nav>
                </div>
            </header>
        </div>
    );
}

export default App;
